import React from 'react';
import ReactDOM from 'react-dom';
import Card from "./Cards";
import "./index.css";
import Series from "./Series";
// console.log(Series[0].sname)

function ncard(val) {
  return (
    <Card
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link} />

  );

}

ReactDOM.render(
  <>
    <h1 className='heading_style'>List of Top 5 series in Netflix</h1>
    {Series.map(function ncard(val){
      return(
        <Card
      imgsrc={val.imgsrc}
      title={val.title}
      sname={val.sname}
      link={val.link} />

      )
    })}


  </>,
  document.getElementById('root'));
